export function ApiView({ champions, apiItem }) {
  // Check if apiItem is provided and exists in the champions object
  const championName = apiItem && champions && champions[apiItem] ? champions[apiItem].name : '';

  return (
      <div>
          {championName ? championName : 'No champion found.'}
      </div>
  );
}
